DROP TABLE IF EXISTS tblUser CASCADE;

create table tblUser (
	user_id SERIAL PRIMARY KEY,
	user_name VARCHAR(25),
	user_email VARCHAR(40),
	user_password VARCHAR(80)
);

DROP TABLE IF EXISTS tblPaymentMethod CASCADE;

CREATE TABLE tblPaymentMethod (
    payment_method_id   SERIAL PRIMARY KEY,
    payment_method      VARCHAR(25)
);


CREATE TABLE tblPaymentMethod (
    payment_method_id   SERIAL PRIMARY KEY,
    payment_method      VARCHAR(25)
);


DROP TABLE IF EXISTS tblCustomer CASCADE;

create table tblCustomer (
	customer_id SERIAL PRIMARY KEY,
	first_name VARCHAR(25),
	last_name VARCHAR(25),
	email VARCHAR(40),
	phone_number VARCHAR(20),
	customer_address VARCHAR(40),
	customer_city VARCHAR(30),
	customer_state VARCHAR(30),
	customer_country VARCHAR(30)
);



DROP TABLE IF EXISTS tblProducts CASCADE;

create table tblProducts (
	product_id SERIAL PRIMARY KEY,
	isbn CHAR(11),
	product_name VARCHAR(100),
	author VARCHAR(30),
	genre VARCHAR(20),
	publisher VARCHAR(20),
	product_type INTEGER,
	description VARCHAR(200)
);


DROP TABLE IF EXISTS tblInventoryConditions CASCADE;

create table tblInventoryConditions (
	condition_id SERIAL PRIMARY KEY,
	condition VARCHAR(25)
);


DROP TABLE IF EXISTS tblInventory CASCADE;

create table tblInventory (
	inventory_id SERIAL PRIMARY KEY,
	product_id INTEGER REFERENCES tblProducts(product_id),
	inventory_condition INTEGER REFERENCES tblInventoryConditions(condition_id),
	amount INTEGER,
	price DECIMAL(12,2),
	notes VARCHAR(250)
);



DROP TABLE IF EXISTS tblOrder CASCADE;

create table tblOrder (
	order_id SERIAL PRIMARY KEY,
	customer_id INTEGER REFERENCES tblCustomer(customer_id),
	date_time integer
);


DROP TABLE IF EXISTS jncOrderItems;

create table jncOrderItems
(
    order_id INTEGER REFERENCES tblOrder(order_id),
    inventory_id INTEGER REFERENCES tblInventory(inventory_id),
    quantity INTEGER
);

